        let modelEntity = null; // Deklarasi modelEntity di scope yang lebih luas
        let truckEntity = null; // Deklarasi truckEntity di scope yang lebih luas

        // Fungsi untuk memperbarui posisi model utama dan truk
        function updateModelAndTruckPosition() {
            const newModelAbsoluteAltitude = currentSliderAlt; // Model utama mengikuti nilai slider
            
            // Update model utama
            const newModelPosition = Cesium.Cartesian3.fromDegrees(initialLon, initialLat, newModelAbsoluteAltitude);
            const newModelOrientation = Cesium.Transforms.headingPitchRollQuaternion(
                newModelPosition,
                new Cesium.HeadingPitchRoll(fixedHeading, 0, 0)
            );
            modelEntity.position = newModelPosition;
            modelEntity.orientation = newModelOrientation;

            // Perbarui posisi truk (jika ada)
            if (truckEntity) {
                // Re-sample position property to apply the new offset
                const positionProperty = new Cesium.SampledPositionProperty();
                const totalDuration = 120; // seconds
                const startTime = viewer.clock.startTime;

                let cumulativeDistances = [0];
                for (let i = 1; i < truckPathData.length; i++) {
                    const coords1 = [truckPathData[i-1][0], truckPathData[i-1][1]];
                    const coords2 = [truckPathData[i][0], truckPathData[i][1]];
                    // Menghitung jarak di bidang datar (Lon, Lat) cukup baik untuk lintasan pendek
                    const dist = Cesium.Cartesian3.distance(
                        Cesium.Cartesian3.fromDegrees(coords1[0], coords1[1]),
                        Cesium.Cartesian3.fromDegrees(coords2[0], coords2[1])
                    );
                    cumulativeDistances.push(cumulativeDistances[i-1] + dist);
                }
                const totalPathLength = cumulativeDistances[cumulativeDistances.length - 1];

                for (let i = 0; i < truckPathData.length; i++) {
                    const lon = truckPathData[i][0];
                    const lat = truckPathData[i][1];
                    // 'alt' di truckPathData sudah relatif terhadap baseAnchorAlt + offset kecil
                    // Jadi, tambahkan Z-offset baru dari slider (currentSliderAlt - baseAnchorAlt)
                    const altForTruck = baseAnchorAlt + truckPathData[i][2] + (currentSliderAlt - baseAnchorAlt);
                    const position = Cesium.Cartesian3.fromDegrees(lon, lat, altForTruck);
                    
                    const timeOffset = totalPathLength > 0 ? (cumulativeDistances[i] / totalPathLength) * totalDuration : 0;
                    const time = Cesium.JulianDate.addSeconds(startTime, timeOffset, new Cesium.JulianDate());
                    positionProperty.addSample(time, position);
                }
                truckEntity.position = positionProperty;
                viewer.clock.currentTime = startTime; // Reset animation to apply new path
            }
        }

        try {
            // Inisialisasi model utama
            modelEntity = viewer.entities.add({
                name: '288_12K-Cad-Jl_Kasturi_(Cikijing)_extruded_hollow_utm_28812K_Jl_Kasturi_Balanced_Production_PPSurf_Only_PPSurf_RECONSTRUCTED',
                position: Cesium.Cartesian3.fromDegrees(initialLon, initialLat, baseAnchorAlt), // Posisi awal model

            const speedSlider = document.getElementById('speedSlider');
            const speedValueSpan = document.getElementById('speedValue');
            const playPauseButton = document.getElementById('playPauseButton');
            const resetButton = document.getElementById('resetButton');

            heightSlider.addEventListener('input', function() {
                currentSliderAlt = parseFloat(this.value); // Ambil nilai slider langsung
                heightValueSpan.textContent = `${currentSliderAlt.toFixed(1)} m`;
                updateModelAndTruckPosition(); // Panggil fungsi pembaruan
            });

            // Truck animation setup
            if (truckModelUri && truckPathData.length > 1) {
                console.log("Membuat jalur dan animasi truk...");
                
                // Inisialisasi awal properti posisi truk
                const initialTruckPositionProperty = new Cesium.SampledPositionProperty();
                const totalDuration = 120; 
                const startTime = viewer.clock.startTime;

                let cumulativeDistances = [0];
                for (let i = 1; i < truckPathData.length; i++) {
                    const coords1 = [truckPathData[i-1][0], truckPathData[i-1][1]];
                    const coords2 = [truckPathData[i][0], truckPathData[i][1]];
                    const dist = Cesium.Cartesian3.distance(
                        Cesium.Cartesian3.fromDegrees(coords1[0], coords1[1]),
                        Cesium.Cartesian3.fromDegrees(coords2[0], coords2[1])
                    );
                    cumulativeDistances.push(cumulativeDistances[i-1] + dist);
                }
                const totalPathLength = cumulativeDistances[cumulativeDistances.length - 1];

                for (let i = 0; i < truckPathData.length; i++) {
                    const lon = truckPathData[i][0];
                    const lat = truckPathData[i][1];
                    const alt = truckPathData[i][2]; // Relatif terhadap baseAnchorAlt + offset + extrusion_height

                    const position = Cesium.Cartesian3.fromDegrees(lon, lat, baseAnchorAlt + alt); // Ketinggian awal truk
                    
                    const timeOffset = totalPathLength > 0 ? (cumulativeDistances[i] / totalPathLength) * totalDuration : 0;
                    const time = Cesium.JulianDate.addSeconds(startTime, timeOffset, new Cesium.JulianDate());
                    initialTruckPositionProperty.addSample(time, position);
                }

                viewer.clock.endTime = Cesium.JulianDate.addSeconds(startTime, totalDuration, new Cesium.JulianDate());
                viewer.clock.currentTime = startTime;
                viewer.clock.clockRange = Cesium.ClockRange.LOOP_STOP; 

                truckEntity = viewer.entities.add({
                    availability: new Cesium.TimeIntervalCollection([new Cesium.TimeInterval({
                        start: startTime,
                        stop: viewer.clock.endTime
                    })]),
                    position: initialTruckPositionProperty, // Gunakan properti posisi awal
                    model: {
                        uri: truckModelUri,
                        minimumPixelSize: 64, 
                        maximumScale: 500, 
                        heightReference: Cesium.HeightReference.NONE // Truk juga menggunakan ketinggian absolut
                    },
                    orientation: new Cesium.VelocityOrientationProperty(initialTruckPositionProperty) 
                });

                // Speed slider
                speedSlider.addEventListener('input', function() {
                    viewer.clock.multiplier = parseFloat(this.value);
                    speedValueSpan.textContent = `${viewer.clock.multiplier.toFixed(1)} x`;
                });

                // Play/Pause button
                playPauseButton.addEventListener('click', function() {
                    viewer.clock.shouldAnimate = !viewer.clock.shouldAnimate;
                    this.textContent = viewer.clock.shouldAnimate ? 'Pause' : 'Play';
                });

                // Reset button
                resetButton.addEventListener('click', function() {
                    viewer.clock.currentTime = startTime;
                    viewer.clock.shouldAnimate = true;
                    playPauseButton.textContent = 'Pause';
                });

                viewer.zoomTo(viewer.entities);

            } else {
                console.warn("Jalur truk atau model truk tidak tersedia, tidak akan menampilkan truk.");
            }

        } catch (error) {
            console.error('Gagal memuat model atau mengatur kontrol:', error);
